style:
*{
	margin: 0;
	padding: 0;
	box-sizing: border-box;
}
body{
	background: #000;
}


ul{
	position: absolute;
	top: 0;
	bottom: 0;
	width: 100%;
	height: auto;
	line-height: 100%;
	padding:50% 0;
	overflow-x: hidden;
	overflow-y: auto;
	list-style: none;
  transition: 0.3s all ease;
}
li{
	width:auto;
	word-break: keep-all;
    white-space: nowrap;
    text-overflow: ellipsis;
  margin:10% 0;
	list-style: none;
	text-align: center;
	font-size: 1em;
  color: #aaa;
  font-weight: normal;
  transition: 0.3s all ease;
}
li.active{ 
    color: #fff;
    font-size: 1.125em;
    font-weight: bold;
}

li.active>font{
		color: rgb(54, 127, 196);
}


#toast{
    	position: absolute;
    top: -80px;
    left: 15px;
    line-height: 50px;
    font-size:20px;
    font-weight: bold;
    color:#555;
    padding:0px 20px 0px 20px;
    background: rgb(220, 220, 220,.8);
    	border-radius: 5px;
    transition:top 0.3s cubic-bezier(.38,-0.38,.62,1.54); 
}
#toast.active{
    top: 15px;
}



#player{
	position: absolute;
	bottom:0;
	width:100%;
	height:auto;
}

/* 歌曲信息模块 */
#player-content1{
	position: absolute;
	top:-22px;
	left:15px;
	width:90%;
	height:90px;
	padding:0 20px 0 130px;
	background: rgb(209, 226, 245);
	border-top-left-radius: 10px;
	border-top-right-radius: 10px;
/* transition过渡动画：设置top属性过渡，过渡时间0.3s,速度曲线为ease(逐渐变慢) */
	transition:top 0.3s ease; 
}
#player-content1.active{
	top:-85px;
}

.music-name,.artist-name{
	height: 20px;
	margin-top:5px;
	font-size:14px;
	overflow-x: auto;
}
.artist-name{
	font-size:12px;
	color: #656565
}

.time{
	font-size:12px;
	height:15px;
	margin: 5px 0;
}

.current-time,.total-time{
	float: left;
	color: transparent;
	font-size: 11px;
	background-color: #e8f5ff;
	border-radius: 10px;
	transition: 0.3s ease all;
	color: rgb(54, 127, 196);
	background-color: transparent;
}
.total-time{
	float: right;
}

#s-area, #seek-bar{
	position: relative;
	height: 4px;
	border-radius: 4px;
}

#s-area{
	background-color:#e8f5ff;
	cursor: pointer;
}

#ins-time{
	position: absolute;
	top: -29px;
	color: #fff;
	font-size: 12px;
	white-space: pre;
	padding: 5px 6px;
	border-radius: 4px;
	display:none;
	background-color: #4b4d5c;
}

#seek-bar{
	content: '';
	position: absolute;
	top: 0;
	bottom: 0;
	left: 0;
	width: 0;
	background-color: rgb(54, 127, 196);
	transition: 0.2s ease width;
}

.play-pause{
    position: relative;
    width:100%;
    height:90px;
    background: #fff;
    border-top-left-radius:10px;
    border-top-right-radius:10px;
}
/* 左侧封面图模块 */
.img,img{
	width: 100%;
	height: 100%;
	display: block;
	position: absolute;
	top: 0;left: 0;
	background-repeat: no-repeat;
	background-size: 100%;
}
.music-imgs{
    position: absolute;
    top: -40px;
    width: 100px;
    height: 100px;
    margin-left: 30px;
    -webkit-transform: rotateZ(0);
    transform: rotateZ(0);
    transition: 0.3s ease all;
    box-shadow: 0 0 0 10px #fff;
    border-radius: 50%;
    overflow: hidden;
}
/* 左侧封面图模块添加了active类名 */
.music-imgs.active{
    top: -50px;
    box-shadow: 0 0 0 4px #e8f5ff, 0 30px 50px -15px #afb7c1;
}
.music-imgs:before{
    content: '';
    position: absolute;
    top: 50%;
    right: 0;
    left: 0;
    width: 20px;
    height: 20px;
    margin: -10px auto 0 auto;
    background-color: #d6dee7;
    border-radius: 50%;
    box-shadow: inset 0 0 0 2px #fff;
    z-index: 2;
}


/* 封面图模块添加了active类名后，图片div的样式添加 */
.music-imgs.active .img{
    z-index: 1;
    -webkit-animation: rotateAlbumArt 3s linear 0s infinite forwards;
            animation: rotateAlbumArt 3s linear 0s infinite forwards;
}
@-webkit-keyframes rotateAlbumArt
{
    0%{ -webkit-transform: rotateZ(0); transform: rotateZ(0); }
    100%{ -webkit-transform: rotateZ(360deg); transform: rotateZ(360deg); }
}

@keyframes rotateAlbumArt
{
    0%{ -webkit-transform: rotateZ(0); transform: rotateZ(0); }
    100%{ -webkit-transform: rotateZ(360deg); transform: rotateZ(360deg); }
}
#buffer-box
{
    position: absolute;
    top: 50%;
    right: 0;
    left: 0;
    height: 13px;
    color: #1f1f1f;
    font-size: 13px;
    font-family: Helvetica;
    text-align: center;
    font-weight: bold;
    line-height: 1;
    padding: 6px;
    margin: -12px auto 0 auto;
    background-color: rgba(255, 255, 255, 0.19);
    opacity: 0;
    z-index: 2;
}

.music-imgs .img, #buffer-box
{
    transition: 0.1s linear all;
}

.music-imgs.buffering .img
{
    opacity: 0.25;
}

.music-imgs.buffering .img.active
{
    opacity: 0.8;
    filter: blur(2px);
    -webkit-filter: blur(2px);
}

.music-imgs.buffering #buffer-box
{
    opacity: 1;
}

.btn1, .btn2{
    position:absolute;
    top:20px;
    left:150px;
    width:auto;
    height:60px;
    line-height: 60px;
    font-size:24px;
    font-weight: bold;
    color: #999;
}
.btn2{
    left: 230px;
}
textarea{
	position:fixed;
	bottom:-1px;
	left:-1px;
	width:0;
	height:0;
}

